        <div className="row">
          <div class="p-5 mb-4 bg-light rounded-3">
            <div class="container-fluid py-5 jumbotronStyle">
              <h1 class="display-5 fw-bold">名稱由來</h1>
              <p class="col-md-8 fs-4">
                HCARE是希望可以是希望可以用心看待顧客的家，提供顧客最好的商品，讓顧客在使用之餘不用擔心是否安全!
